import styled from "@emotion/styled";

export const Layout = styled.div`
  height: 100vh;
  display: flex;
`;

export const LayoutContent = styled.div`
  max-width: calc(100% - 208px);
  flex-direction: row;
  flex-grow: 1;
  flex-wrap: wrap;
  position: relative;
`;

export const Content = styled.div`
  display: flex;
  width: 100%;
  box-sizing: border-box;
  height: 100%;
`;
